import{_ as a,c as d,o as r,a9 as e,aa as p,ab as h,ac as i,ad as o,ae as l,af as s,ag as n,ah as c,ai as t,aj as b,ak as m,al as u,am as _,an as q,ao as f,ap as k,aq as P,ar as x,as as g,at as y,au as v,av as w}from"./chunks/framework.CsTY7_eC.js";const I=JSON.parse('{"title":"冒险者传说","description":"","frontmatter":{},"headers":[],"relativePath":"catship.md","filePath":"catship.md","lastUpdated":1727834719000}'),T={name:"catship.md"},B=e('<h1 id="冒险者传说" tabindex="-1">冒险者传说 <a class="header-anchor" href="#冒险者传说" aria-label="Permalink to &quot;冒险者传说&quot;">​</a></h1><p>这一世，我重生了，上一世我被 boss 血虐，这次，我要用我上一世的记忆翻盘。</p><h1 id="搜刮" tabindex="-1">搜刮 <a class="header-anchor" href="#搜刮" aria-label="Permalink to &quot;搜刮&quot;">​</a></h1><p>参考：</p><ul><li><a href="https://www.bilibili.com/video/BV1Wy411b7N3" target="_blank" rel="noreferrer">https://www.bilibili.com/video/BV1Wy411b7N3</a></li></ul><h2 id="开始" tabindex="-1">开始 <a class="header-anchor" href="#开始" aria-label="Permalink to &quot;开始&quot;">​</a></h2><h3 id="开始房间" tabindex="-1">开始房间 <a class="header-anchor" href="#开始房间" aria-label="Permalink to &quot;开始房间&quot;">​</a></h3><p><img src="'+p+'" alt=""></p><p>在开始房间的箱子中可以得到一个附魔金苹果</p><p>接着选择单人普通模式，可以得到这些东西</p><p><img src="'+h+'" alt=""></p><p>我选择魔力使</p><p><img src="'+i+'" alt=""></p><h3 id="隐藏箱子" tabindex="-1">隐藏箱子 <a class="header-anchor" href="#隐藏箱子" aria-label="Permalink to &quot;隐藏箱子&quot;">​</a></h3><p>站在箱子上，对着这幅画立定跳远，多试几次</p><p><img src="'+o+'" alt=""></p><p>里面有一个箱子</p><p><img src="'+l+'" alt=""></p><h3 id="箱子下的熔炉" tabindex="-1">箱子下的熔炉 <a class="header-anchor" href="#箱子下的熔炉" aria-label="Permalink to &quot;箱子下的熔炉&quot;">​</a></h3><p>在这里，箱子下面的熔炉里有 1 枚 钻石钱币</p><p><img src="'+s+'" alt=""></p><h3 id="南瓜灯" tabindex="-1">南瓜灯 <a class="header-anchor" href="#南瓜灯" aria-label="Permalink to &quot;南瓜灯&quot;">​</a></h3><p>对着南瓜灯的按钮点按，可以得到 8 个 精铁钱币 和 1 枚细心者之戒</p><p><img src="'+n+'" alt=""></p><h3 id="收益" tabindex="-1">收益 <a class="header-anchor" href="#收益" aria-label="Permalink to &quot;收益&quot;">​</a></h3><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>精铁钱币</td><td>8</td></tr><tr><td>黄金钱币</td><td>1</td></tr><tr><td>钻石钱币</td><td>1</td></tr><tr><td>蓝宝石</td><td>1</td></tr></tbody></table><h2 id="冒险家训练场" tabindex="-1">冒险家训练场 <a class="header-anchor" href="#冒险家训练场" aria-label="Permalink to &quot;冒险家训练场&quot;">​</a></h2><p>这里的箱子非常明显，就不写了</p><p>直接看收益</p><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>精铁钱币</td><td>1</td></tr><tr><td>黄金钱币</td><td>2</td></tr><tr><td>钻石钱币</td><td>1</td></tr></tbody></table><p>用盾反击败 &quot;知名的冒险家&quot; 可以得到 1 枚 钻石钱币</p><p>我把所有的 通用火枪子弹 都省下来了，后面打火枪好用</p><h2 id="冒险区" tabindex="-1">冒险区 <a class="header-anchor" href="#冒险区" aria-label="Permalink to &quot;冒险区&quot;">​</a></h2><h3 id="冒险小屋" tabindex="-1">冒险小屋 <a class="header-anchor" href="#冒险小屋" aria-label="Permalink to &quot;冒险小屋&quot;">​</a></h3><p>向上看，有个熔炉，里面有 1 个 钻石钱币</p><p><img src="'+c+'" alt=""></p><p>旁边的熔炉里有 1 个熟鸡肉</p><p>一楼桌子上的曲奇罐可以 下蹲+空手右键 打开，可以收到名为 “干粮” 的曲奇 16 个</p><h3 id="冒险者协会" tabindex="-1">冒险者协会 <a class="header-anchor" href="#冒险者协会" aria-label="Permalink to &quot;冒险者协会&quot;">​</a></h3><p>出去小屋后在坐标 672 63 -480 处上梯子</p><p>将减速的魔力转换器先存到背包，脱掉会减速的装备，最好穿可以加速的装备，同时你还可以手持一件有加速效果的装备</p><p>最好可以来瓶速度药水，比如你可以使用 <a href="#四楼">柠檬茶</a></p><p><img src="'+t+'" alt=""></p><p>跳上十字准心所指的房顶</p><p>下了楼梯之后可以摸到 16 个精铁钱币 和 耀骑士胸甲</p><h3 id="得意驴" tabindex="-1">得意驴 <a class="header-anchor" href="#得意驴" aria-label="Permalink to &quot;得意驴&quot;">​</a></h3><p>在坐标 671 64 -515 处可以在得意驴身上拿到 1 个 钻石钱币 和 1 个面包</p><h3 id="水池" tabindex="-1">水池 <a class="header-anchor" href="#水池" aria-label="Permalink to &quot;水池&quot;">​</a></h3><p>将物品丢到压力板上就会激活发射器弹出物品</p><p><img src="'+b+'" alt=""></p><p>可以得到</p><table><thead><tr><th>项目</th><th>数量</th></tr></thead><tbody><tr><td>精铁钱币</td><td>9</td></tr><tr><td>黄金钱币</td><td>13</td></tr></tbody></table><p>特别的，可以得到 1 颗 魔晶石</p><h3 id="每日宝箱" tabindex="-1">每日宝箱 <a class="header-anchor" href="#每日宝箱" aria-label="Permalink to &quot;每日宝箱&quot;">​</a></h3><div class="language- vp-adaptive-theme line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code"><code><span class="line"><span>每日宝箱的收益将不会计入最后的收益一览</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><p>黄色的每日宝箱收益：</p><table><thead><tr><th>项目</th><th>数量</th><th>概率</th></tr></thead><tbody><tr><td>金粒</td><td>4</td><td>100%</td></tr><tr><td>精铁钱币</td><td>5</td><td>100%</td></tr><tr><td>黄金钱币</td><td>2</td><td>100%</td></tr><tr><td>黄金钱币</td><td>100</td><td>1%</td></tr><tr><td>钻石钱币</td><td>1</td><td>15%</td></tr><tr><td>青铜钱币</td><td>16</td><td>1%</td></tr></tbody></table><p>特别的，黄色的每日宝箱有 1% 的概率掉落 金色的柱状武器</p><p>蓝色的魔力箱子收益：</p><table><thead><tr><th>项目</th><th>数量</th><th>概率</th></tr></thead><tbody><tr><td>精铁钱币</td><td>6</td><td>27%</td></tr><tr><td>精铁钱币</td><td>6</td><td>34%</td></tr><tr><td>魔力</td><td>1</td><td>100%</td></tr><tr><td>魔力</td><td>2</td><td>23%</td></tr><tr><td>魔力</td><td>2</td><td>15%</td></tr><tr><td>蓝宝石</td><td>16</td><td>6%</td></tr><tr><td>神奇的晶粉</td><td>1</td><td>31%</td></tr></tbody></table><p>特别的，蓝色的魔力箱子有 3% 的概率掉落 诅咒魔剑</p><h3 id="一楼" tabindex="-1">一楼 <a class="header-anchor" href="#一楼" aria-label="Permalink to &quot;一楼&quot;">​</a></h3><p>在有每日宝箱的这个楼层，可以在箱子中找到 4 个 黄金钱币 和 5 个名为 “5周年爱心饼干” 的曲奇</p><p><img src="'+m+'" alt=""></p><p>每日宝箱后的房间中，箭头所指的箱子内有 16 只箭</p><p><img src="'+u+'" alt=""></p><h3 id="二楼" tabindex="-1">二楼 <a class="header-anchor" href="#二楼" aria-label="Permalink to &quot;二楼&quot;">​</a></h3><p>没找到宝箱</p><h3 id="三楼" tabindex="-1">三楼 <a class="header-anchor" href="#三楼" aria-label="Permalink to &quot;三楼&quot;">​</a></h3><p>在新武器研究员这里的箱子可以得到 16 枚名为 “Musket Round” 的火枪子弹</p><p>坐标参考：686 76 -490</p><p><img src="'+_+'" alt=""></p><h3 id="四楼" tabindex="-1">四楼 <a class="header-anchor" href="#四楼" aria-label="Permalink to &quot;四楼&quot;">​</a></h3><p>领袖面对的方向，桌子上可以右键得到一瓶柠檬茶</p><p><img src="'+q+'" alt=""></p><p>在你面对领袖时，右手方向的门中可以</p><p>在箭头所指的漏斗中找到 1 个收集品 “冒险者的宣誓——BY塞弗尔·威”</p><p><img src="'+f+'" alt=""></p><p>在面对领袖时。左手方向的们中可以看到一个展示盒</p><p>空手右键可以取下里面的 1 个 钻石钱币</p><p><img src="'+t+'" alt=""></p><h3 id="屋顶" tabindex="-1">屋顶 <a class="header-anchor" href="#屋顶" aria-label="Permalink to &quot;屋顶&quot;">​</a></h3><p>在你面对领袖时，右手方向的门中可以看到这幅画</p><p>画的右半部分可穿过</p><p><img src="'+k+'" alt=""></p><p>出去之后向左走，找到</p><p><img src="'+P+'" alt=""></p><p>参考坐标 691 81 -509</p><p>爬上梯子，在信标旁可以找到一个箱子，箱子里是 苍白断剑</p><p>坐标 690 90 -503</p><h3 id="弓箭手·神准箭" tabindex="-1">弓箭手·神准箭 <a class="header-anchor" href="#弓箭手·神准箭" aria-label="Permalink to &quot;弓箭手·神准箭&quot;">​</a></h3><p>在 穿过画向由走 或在 屋顶 拿完箱子后跳下去，可以找到这个 npc</p><p>他旁边的箱子里有 1 个收集品 “冒险者之剑”</p><p><img src="'+x+'" alt=""></p><p>坐标 684 80 -506</p><h3 id="树上箱子" tabindex="-1">树上箱子 <a class="header-anchor" href="#树上箱子" aria-label="Permalink to &quot;树上箱子&quot;">​</a></h3><p><img src="'+g+'" alt=""></p><p>里面有 16 个 精铁钱币</p><p>坐标 684 77 -526</p><h3 id="帆上箱子" tabindex="-1">帆上箱子 <a class="header-anchor" href="#帆上箱子" aria-label="Permalink to &quot;帆上箱子&quot;">​</a></h3><p>在树上，你可以跳到帆上，拿到 耀骑士头盔</p><p><img src="'+y+'" alt=""></p><h3 id="矮人的商船" tabindex="-1">矮人的商船 <a class="header-anchor" href="#矮人的商船" aria-label="Permalink to &quot;矮人的商船&quot;">​</a></h3><p><img src="'+v+'" alt=""></p><p>在 帆上箱子 旁的 矮人矮人商船 可以找到 1 个蓝宝石（图中准星所指箱子）</p><h3 id="风车" tabindex="-1">风车 <a class="header-anchor" href="#风车" aria-label="Permalink to &quot;风车&quot;">​</a></h3><p><img src="'+w+'" alt=""></p><p>参考坐标 624 69 -530</p><h4 id="底部" tabindex="-1">底部 <a class="header-anchor" href="#底部" aria-label="Permalink to &quot;底部&quot;">​</a></h4><p>进入底部，杀掉恶犬，从旁边的箱子中可以得到</p><p>6 个 黄金钱币</p><p>2 个 金粒</p><h4 id="背面" tabindex="-1">背面 <a class="header-anchor" href="#背面" aria-label="Permalink to &quot;背面&quot;">​</a></h4><p>坐标 597 88 -553</p><p>可以从箱子中得到</p><p>2 个 黄金钱币</p><p>1 个 魔力</p><p>1 把 火焰弓</p><h4 id="内部" tabindex="-1">内部 <a class="header-anchor" href="#内部" aria-label="Permalink to &quot;内部&quot;">​</a></h4><p>使用电梯上到顶楼，可以得到</p><p>4 个 精铁钱币</p><p>3 个金粒</p><p>注：抬头可以看到装金粒的箱子</p><h3 id="罐子" tabindex="-1">罐子 <a class="header-anchor" href="#罐子" aria-label="Permalink to &quot;罐子&quot;">​</a></h3><p>在树下 坐标 621 65 -486 处可以找到三个罐子</p><p>可以使用 冒险家训练场 的魔力剑来开罐子</p><table><thead><tr><th>项目</th><th>数量</th><th>概率</th></tr></thead><tbody><tr><td>幽灵核心</td><td>1</td><td>20%</td></tr><tr><td>金粒</td><td>1</td><td>100%</td></tr><tr><td>精铁钱币</td><td>1</td><td>100%</td></tr><tr><td>神圣洗礼</td><td>1</td><td>5%</td></tr><tr><td>罐中剑</td><td>1</td><td>1%</td></tr><tr><td>罐中盔</td><td>1</td><td>2%</td></tr><tr><td>罐中弓</td><td>1</td><td>2%</td></tr><tr><td>治疗药水</td><td>1</td><td>50%</td></tr></tbody></table><h2 id="土豪区" tabindex="-1">土豪区 <a class="header-anchor" href="#土豪区" aria-label="Permalink to &quot;土豪区&quot;">​</a></h2><p>TODO</p>',129),N=[B];function S(V,C,$,A,D,O){return r(),d("div",null,N)}const R=a(T,[["render",S]]);export{I as __pageData,R as default};
